import React from "react";
import Product from "./Product";

function ProductList(products){
   return(<div>
{
   products.map(function(item)
   {
      return (<Product 
      title={item.title}
      category={item.category}
      imgurl={item.imgurl}
      price={item.price}
      />);
   })
}


</div>);
}

export default ProductList;
